// @flow strict

// Navigation
const Navigation = ({ next, previous, setQuery }: Props) => {
	console.log(next, previous);
	return (
		<React.Fragment>
			<List>
				<ListItem>
					<button onClick={() => setQuery(previous)}>Previous</button>
				</ListItem>

				<ListItem>
					<button onClick={() => setQuery(next)}>Next</button>
				</ListItem>
			</List>
		</React.Fragment>
	)
}

// Export
export { Navigation };
